/* harmony default export */ __webpack_exports__["default"] = ("<section class=\"section-inner-subheader\">\n    <div class=\"breadcum\">\n        <a>\n            <i class=\"icon icon-ex-small\">\n                <svg focusable=\"false\">\n                    <use xlink:href=\"#icon_home\"></use>\n                </svg>\n            </i>\n        </a>\n        <span> |</span>\n        <a>\n            The Premia Corner \n        </a>\n    </div>\n\n</section>\n\n<!--\n<section class=\"blob-article\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\">\n                <div class=\"panel\">\n                    <h2>Check mate!  We would like to invite you to<br>\n                Gorki campus to take part in our traditional<br>\n                Сambridge Chess Tournament 2020.</h2>\n                    <p>\n                        We are a group of committed individuals who believe that “What sculpture is to a block of marble, education is to the human soul.” Joseph Addison.\n                        <br>\n                        <br> Our advisory board comprises of diverse academicians who have a keen interest in providing a unique perspective to our collective vision. Individually they have contributed tremendously to the field of education, together they bring their unique capacities to our advisory board supporting continual improvement and sustainability.\n                        <br>\n                        <br> We want to nurture a confident, compassionate student body that is ready to make a positive difference to the World. We affirm that every child deserves a childhood filled with love and positivism. That is the core belief, with which we will take care of each child, as this will contribute to making exemplary individuals.\n                    </p>\n                </div>\n                <div class=\"btn-wrapper\">\n                    <div class=\"div-btn\">\n                        <button class=\"btn btn-primary\" (click)=\"knowMore('culture');\">\n                            READ MORE\n                        </button>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n-->\n\n<section class=\"recent-article\">\n    <div class=\"container\">\n        <div class=\"col-lg-12 col-md-12 col-sm-12\">\n            <!--            <h6>The Premia Corner</h6>-->\n            <h2><span>Premia Blogs</span></h2>\n        </div>\n        <div class=\"row\">\n            <ngx-slick-carousel class=\"carousel\" #slickModal=\"slick-carousel\" [config]=\"recentConfig\">\n                <!--\n                <div ngxSlickItem *ngFor=\"let item of admission; index as i\" class=\"slide col-lg-4 col-md-4 col-sm-12\">\n                    <div class=\"panel\">\n\n                        <div class=\"panel-heading\">\n                                                        <p>{{item.date}}</p>\n                            <h3>{{item.title}}</h3>\n                        </div>\n\n                        <div class=\"panel-body\">\n                            <p>{{item.description}}</p>\n                        </div>\n\n                    </div>\n                    <button class=\"btn btn-primary\" (click)=\"notifyOpen(premiabloglisti)\">\n                        READ MORE\n                    </button>\n\n\n\n                </div>\n-->\n                <div ngxSlickItem class=\"slide col-lg-4 col-md-4 col-sm-12\">\n                    <div class=\"panel\">\n\n                        <div class=\"panel-heading\">\n\n                            <h3>Developing Language Across the Curriculum in Premia Academy</h3>\n                        </div>\n\n                        <div class=\"panel-body\">\n                            <p>Developing competence in the language of instruction is the goal of all teaching activity throughout the school day at the Premia Academy. We believe that literacy is the most fundamental competency necessary for our school’s success. The everyday social language, formal academic language, and subject matter vocabulary are all critical in the holistic development of the students’ at the Premia Academy.\n                            </p>\n                        </div>\n\n                    </div>\n                    <button class=\"btn btn-primary\" (click)=\"notifyOpen(premiabloglist1)\">\n                        READ MORE\n                    </button>\n\n                </div>\n\n                <div ngxSlickItem class=\"slide col-lg-4 col-md-4 col-sm-12\">\n                    <div class=\"panel\">\n\n                        <div class=\"panel-heading\">\n\n                            <h3>Gaming Addiction or Enthusiasm</h3>\n                        </div>\n\n                        <div class=\"panel-body\">\n                            <p>Games are great things that many enjoy. But things can go too far with a hobby! So, at what point does a gaming hobby become an addiction? That’s an important question experts have been trying to answer about playing video games.</p>\n                        </div>\n\n                    </div>\n                    <button class=\"btn btn-primary\" (click)=\"notifyOpen(premiabloglist2)\">\n                        READ MORE\n                    </button>\n\n                </div>\n                <div ngxSlickItem class=\"slide col-lg-4 col-md-4 col-sm-12\">\n                    <div class=\"panel\">\n\n                        <div class=\"panel-heading\">\n\n                            <h3>Pedagogy- The Art and Science of Teaching Applied at The Premia Academy</h3>\n                        </div>\n\n                        <div class=\"panel-body\">\n                            <p>Teachers at The Premia Academy believe in the motto- Teaching is an art as well as science. Teaching at The Premia Academy inspires our children to think differently and it develops critical thinking in young, influenceable minds.</p>\n                        </div>\n\n                    </div>\n                    <button class=\"btn btn-primary\" (click)=\"notifyOpen(premiabloglist3)\">\n                        READ MORE\n                    </button>\n\n                </div>\n\n            </ngx-slick-carousel>\n        </div>\n    </div>\n</section>\n\n\n<section class=\"recent-article\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <!--\n            <div class=\"col-lg-6 col-md-6 col-sm-12\" (click)=\"notifyOpen(premiaBlogs1)\">\n                <div class=\"panel\">\n                    <img src=\"assets/images/premia-corner-1.jpg\">\n                    <h4 class=\"center\" data-aos=\"fade-up\" data-aos-once=\"true\">Premia Blogs</h4>\n                </div>\n            </div>\n-->\n\n            <div class=\"col-lg-6 col-md-6 col-sm-12\" (click)=\"notifyOpen(premiaBlogs2)\">\n                <div class=\"panel\">\n                    <img src=\"assets/images/premia-corner-2.jpg\">\n                    <h4 class=\"center\" data-aos=\"fade-up\" data-aos-once=\"true\">Students Work</h4>\n                </div>\n            </div>\n\n            <div class=\"col-lg-6 col-md-6 col-sm-12\" (click)=\"notifyOpen(premiaBlogs3)\">\n                <div class=\"panel\">\n                    <img src=\"assets/images/premia-corner-3.jpg\">\n                    <h4 class=\"center\" data-aos=\"fade-up\" data-aos-once=\"true\">Hands on Learning</h4>\n                </div>\n            </div>\n\n            <div class=\"col-lg-6 col-md-6 col-sm-12\" (click)=\"notifyOpen(premiaBlogs4)\">\n                <div class=\"panel\">\n                    <img src=\"assets/images/premia-corner-4.jpg\">\n                    <h4 class=\"center\" data-aos=\"fade-up\" data-aos-once=\"true\">Premia events</h4>\n                </div>\n            </div>\n\n        </div>\n    </div>\n</section>\n\n\n<ng-template #premiabloglist1 let-modal>\n    <div class=\"modal-header\">\n        <i class=\"icon icon-ex-small\">\n                    <svg focusable=\"false\">\n                        <use xlink:href=\"#icon_noticeBoard\"></use>\n                    </svg>\n                        </i>\n        <h4 class=\"modal-title\" id=\"modal-basic-title1\" style=\"color: #000 !important;font-size: 22px;\">Developing Language Across the Curriculum in Premia Academy</h4>\n        <a class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n            <i class=\"icon icon-ex-small\">\n                          <svg focusable=\"false\">\n                            <use xlink:href=\"#icon_close\"></use>\n                          </svg>\n                        </i>\n        </a>\n    </div>\n    <div class=\"modal-body\" style=\"margin-top: 30px;\">\n        <p style=\"color: #000;font-size: 18px;\">Developing competence in the language of instruction is the goal of all teaching activity throughout the school day at the Premia Academy. We believe that literacy is the most fundamental competency necessary for our school’s success. The everyday social language, formal academic language, and subject matter vocabulary are all critical in the holistic development of the students’ at the Premia Academy.\n            <br>\n            <br> Language development at all levels — informal, problem-solving, and academic needs to be cultivated through use and through purposeful, deliberate conversation between teacher and students and not through drills and decontextualized traditional rules. Reading and writing will be taught both as explicit curricula and integrated into each content area. The ways of using language will prevail in teaching e.g. different ways of asking and answering questions, challenging claims, and using representations. These ways are unfamiliar to many students. The teachers also understand that the students’ own culturally based ways of talking can be effectively linked to the language used for academic disciplines by building learning contexts that draw out and build upon children’s language strengths.\n            <br>\n            <br> The development of language and literacy as a goal at the Premia Academy also applies to the specialized language genres required for the study of science, mathematics, history, art, literature and social emotional learning. Effective mathematics learning for students is based on the ability to “speak mathematics,” which is the overall ability of the students to achieve across the curriculum and dependent on mastery of the language of instruction. Thus applies especially to the solving of word problems. Reading, writing, speaking, listening, and vocabulary is taught and learned in every subject matter. Integrated curriculum provides an ideal venue for developing the language of the activity’s domain.\n            <br>\n            <br> At The Premia Academy, teachers practice the following to make sure that there is appropriate development of the English Language:\n            <br>\n            <br> Teachers listen to student talk about familiar topics such as home and community at every grade Level.\n            <br>\n\n        </p>\n        <ul>\n            Our Teachers:\n            <li>Respond to students’ talk and questions, making impromptu changes during conversation that directly relate to students’ comments. </li>\n            <li>Assist written and oral language development through modelling, eliciting, probing, restating, clarifying, questioning, praising, etc., in purposeful conversation and writing.</li>\n            <li>Interact with students in ways that respect students’ preferences for speaking that may be different from the teacher’s, such as wait-time, eye contact and turn-taking</li>\n            <li>Connect student’s language with literacy and content area knowledge through speaking, listening, reading and writing activities.</li>\n            <li>\n                Encourage students to use content vocabulary to express their understanding of the subject.\n            </li>\n            <li>Provide frequent opportunity for students to interact with each other and the teacher during all instructional activities.</li>\n            <li>Encourage students’ use of first and second languages in instructional activities.</li>\n\n        </ul>\n    </div>\n</ng-template>\n\n<ng-template #premiabloglist2 let-modal>\n    <div class=\"modal-header\">\n        <i class=\"icon icon-ex-small\">\n                    <svg focusable=\"false\">\n                        <use xlink:href=\"#icon_noticeBoard\"></use>\n                    </svg>\n                        </i>\n        <h4 class=\"modal-title\" id=\"modal-basic-title1\" style=\"color: #000 !important;font-size: 22px;\">Gaming Addiction or Enthusiasm</h4>\n        <a class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n            <i class=\"icon icon-ex-small\">\n                          <svg focusable=\"false\">\n                            <use xlink:href=\"#icon_close\"></use>\n                          </svg>\n                        </i>\n        </a>\n    </div>\n    <div class=\"modal-body\" style=\"margin-top: 30px;\">\n        <p style=\"color: #000;font-size: 18px;\">Games are great things that many enjoy. But things can go too far with a hobby! So, at what point does a gaming hobby become an addiction? That’s an important question experts have been trying to answer about playing video games.\n            <br>\n            <br> Gaming has been around for almost 50 years and studies about its harms are in the early stages. Experts have come to different conclusions about whether problem gaming should be called an addiction.\n            <br>\n            <br> It is important for parents to know the warning signs of problem gaming addiction. These problems can happen whether games are played online or offline. Here are some of the warning signs:\n\n        </p>\n        <ul>\n            <li>Thinking about gaming all or most of the time </li>\n            <li>Feeling disheartened when the one can’t play</li>\n            <li>Having the urge to spend more and more time playing to feel good</li>\n            <li>Not being able to quit or even play less</li>\n            <li>\n                Not wanting to do other things that the he/she used to like\n            </li>\n            <li>Having problems at school or home because of gaming addiction</li>\n            <li>Lying to family about how much time is spent playing</li>\n            <li>Using gaming to ease bad moods and feelings</li>\n            <li>Neglecting personal hygiene</li>\n\n        </ul>\n        <br>\n        <p style=\"color: #000;font-size: 18px;\">At present, treating gaming addiction can be obtained in two ways:</p>\n        <ul>\n            <li>Individualized treatment with a certified and experienced professional for treating addictions</li>\n            <li>Group therapy or similar programs if available.</li>\n        </ul>\n        <br>\n        <p style=\"color: #000;font-size: 18px;\">Not everyone who plays a lot has a problem with gaming. Expert opinion says that it is harmful to label people as addicted who might just be very enthusiastic about gaming. But, parents need to be to vigilant about the demarcation between addiction and enthusiasm for gaming. Parents need to make sure that the games are age appropriate and content appropriate. Engaging with the child, playing together, setting healthy limits and actively finding a variety of activities for children to consume online helps . This approach if started at an early age, will keep gaming safe and sensible for most youngsters.</p>\n    </div>\n</ng-template>\n\n<ng-template #premiabloglist3 let-modal>\n    <div class=\"modal-header\">\n        <i class=\"icon icon-ex-small\">\n                    <svg focusable=\"false\">\n                        <use xlink:href=\"#icon_noticeBoard\"></use>\n                    </svg>\n                        </i>\n        <h4 class=\"modal-title\" id=\"modal-basic-title1\" style=\"color: #000 !important;font-size: 22px;\">Pedagogy- The Art and Science of Teaching Applied at The Premia Academy</h4>\n        <a class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n            <i class=\"icon icon-ex-small\">\n                          <svg focusable=\"false\">\n                            <use xlink:href=\"#icon_close\"></use>\n                          </svg>\n                        </i>\n        </a>\n    </div>\n    <div class=\"modal-body\" style=\"margin-top: 30px;\">\n        <p style=\"color: #000;font-size: 18px;\">Teachers at The Premia Academy believe in the motto- Teaching is an art as well as science. Teaching at The Premia Academy inspires our children to think differently and it develops critical thinking in young, influenceable minds.\n\n            <br>\n            <br> The students will acquire language, science and mathematical skills that they can use later on in life. We want education to have a recurring impact, long after our students become adults.\n            <br>\n            <br> The principles of teaching are constantly evolving; collaborative learning, flipped learning and deep learning are all a mainstay of the modern classroom at The Premia Academy.\n\n            <br>\n            <br> Teachers are trained in collaborative learning method of active learning that relies on the principle of two or more students working together, towards a common goal. All activities vary widely, but most centre on the learner’s exploration or application of the curriculum, Within pedagogy, there are four learner profiles at The Premia Academy-\n            <br>\n\n        </p>\n        <ul>\n            <li>Auditory learners who benefit from listening to the information presented to them in classroom. These students learn orally from both listening to instruction from the teacher, audio and video recordings. </li>\n            <li>Tactile/kinaesthetic learners who absorb knowledge through touch and movement. These students prefer to work with hands-on devices and learning aids.</li>\n            <li>Visual learners who prefer to see information in order to visualise the relationship between ideas and concepts to understand them. </li>\n            <li>Reading and writing learners who prefer to take on information by reading texts. These learners can further absorb information by condensing and rephrasing it.</li>\n            <li>\n                Encourage students to use content vocabulary to express their understanding of the subject.\n            </li>\n            <li>Provide frequent opportunity for students to interact with each other and the teacher during all instructional activities.</li>\n\n        </ul>\n        <br>\n        <p style=\"color: #000;font-size: 18px;\">Teachers have the advantage of utilising traditional learning practices while incorporating new educational technologies to create a diverse, differentiated classroom, ready for all learners coming to The Premia Academy.</p>\n    </div>\n</ng-template>\n\n<ng-template #premiaBlogs1 let-modal>\n    <div class=\"modal-header\">\n        <i class=\"icon icon-ex-small\">\n        <svg focusable=\"false\">\n            <use xlink:href=\"#icon_noticeBoard\"></use>\n        </svg>\n    </i>\n        <h4 class=\"modal-title\" id=\"modal-basic-title\">Premia Blogs</h4>\n        <a class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n            <i class=\"icon icon-ex-small\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_close\"></use>\n              </svg>\n            </i>\n        </a>\n    </div>\n    <div class=\"modal-body\">\n        <ngx-gallery [options]=\"galleryOptions\" [images]=\"galleryImages\"></ngx-gallery>\n\n    </div>\n</ng-template>\n\n<ng-template #premiaBlogs3 let-modal>\n    <div class=\"modal-header\">\n        <i class=\"icon icon-ex-small\">\n        <svg focusable=\"false\">\n            <use xlink:href=\"#icon_noticeBoard\"></use>\n        </svg>\n    </i>\n        <h4 class=\"modal-title\" id=\"modal-basic-title\">Hand on Learning</h4>\n        <a class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n            <i class=\"icon icon-ex-small\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_close\"></use>\n              </svg>\n            </i>\n        </a>\n    </div>\n    <div class=\"modal-body\">\n        <ngx-gallery [options]=\"galleryOptions\" [images]=\"hlImages\"></ngx-gallery>\n\n    </div>\n</ng-template>\n\n<ng-template #premiaBlogs2 let-modal>\n    <div class=\"modal-header\">\n        <i class=\"icon icon-ex-small\">\n        <svg focusable=\"false\">\n            <use xlink:href=\"#icon_noticeBoard\"></use>\n        </svg>\n    </i>\n        <h4 class=\"modal-title\" id=\"modal-basic-title\">Students Work</h4>\n        <a class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n            <i class=\"icon icon-ex-small\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_close\"></use>\n              </svg>\n            </i>\n        </a>\n    </div>\n    <div class=\"modal-body\">\n        <ngx-gallery [options]=\"galleryOptions\" [images]=\"swImages\"></ngx-gallery>\n\n    </div>\n</ng-template>\n\n<ng-template #premiaBlogs4 let-modal>\n    <div class=\"modal-header\">\n        <i class=\"icon icon-ex-small\">\n        <svg focusable=\"false\">\n            <use xlink:href=\"#icon_noticeBoard\"></use>\n        </svg>\n    </i>\n        <h4 class=\"modal-title\" id=\"modal-basic-title\">Premia events</h4>\n        <a class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n            <i class=\"icon icon-ex-small\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_close\"></use>\n              </svg>\n            </i>\n        </a>\n    </div>\n    <div class=\"modal-body\">\n        <ngx-gallery [options]=\"galleryOptions\" [images]=\"peImages\"></ngx-gallery>\n\n    </div>\n</ng-template>\n");

