/* harmony default export */ __webpack_exports__["default"] = ("<section class=\"premia-ethos\">\n    <div class=\"breadcum\">\n        <a>\n            <i class=\"icon icon-ex-small\">\n        <svg focusable=\"false\">\n          <use xlink:href=\"#icon_home\"></use>\n        </svg>\n      </i>\n        </a>\n        <span> |</span>\n        <a>\n      Premia ETHOS\n    </a>\n    </div>\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12 mb-5\">\n                <h1 data-aos=\"fade-up\" data-aos-once=\"true\">\n          Premia ETHOS\n        </h1>\n\n\n                <div class=\"panel-body\">\n                    <h2 class=\"\">The culture and atmosphere of our school\n          </h2>\n\n                    <!-- <p class=\"mb-5\">\n            The Premia Academy was founded on the belief that every child has the potential to make the world a\n            beautiful place. Every child is unique and capable of learning when stimulated properly. Premiaa Academy\n            believes in the development of these primary areas. <br>\n            Every institution has a framework or ground rules that they function with for the empowerment of every\n            stakeholder. We at Premia like to call it the Premia ethos. We aspire to build a positive and progressive\n            culture in our school, not only within our corridors and premises but in the very lives of all who are a\n            part of our journey-children, parents, teachers, staff and administration. <br>\n            We revisit our methods from time to time to ensure that we constantly and consistently keep soaring towards\n            our goal of engendering an atmosphere to empower SOCIALLY RESPONSIBLE CITIZENSHIP.<br>\n            While most would say food and water and the basic needs of life help a child survive, we at the Premia\n            Academy beg to differ, we strongly believe that safety, love and a positive learning environment helps\n            children thrive.\n\n          </p> -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-12 col-md-12 col-sm-12 mt-5\">\n                <div class=\"row\">\n\n                    <div class=\"col-lg-3 col-md-3 col-sm-12 ethos-col\" *ngFor=\"let item of ehtos; index as i\">\n                        <h3 class=\"click-event\">\n            {{item.title}}\n            <span (click)=\"onClick(i+1)\">Read More</span>\n          </h3>\n                        <div class=\"circle\">\n                            <img src=\"assets/images/ethos-{{i+1}}.png\" alt=\"\">\n                        </div>\n                    </div>\n                    <div class=\"rocket\">\n                        <img src=\"assets/images/rocket.png\" alt=\"\">\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-lg-12 col-md-12 col-sm-12\">\n                <div class=\"row ethos-2\">\n                    <div class=\"col-lg-3 col-md-3 col-sm-12 ethos-col-2\" *ngFor=\"let item of ehtos2; index as i\">\n                        <div class=\"circle\">\n                            <img src=\"assets/images/ethos-{{i+5}}.png\" alt=\"\">\n                        </div>\n                        <h3 class=\"click-event\">\n            {{item.title}}\n            <span (click)=\"onClick(i+5)\">Read More</span>\n          </h3>\n                    </div>\n                </div>\n            </div>\n\n        </div>\n    </div>\n    <div class=\"container\">\n        <div class=\"row white\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <p> The Premia Academy was founded on the belief that every child has the potential to make the world a beautiful place. Every child is unique and capable of learning when stimulated properly. Premia Academy believes in the development of these primary areas. Every institution has a framework or ground rules that they function with for the empowerment of every stakeholder. We at Premia like to call it the Premia ethos. We aspire to build a positive and progressive culture in our school, not only within our corridors and premises but in the very lives of all who are a part of our journey-children, parents, teachers, staff and administration. We revisit our methods from time to time to ensure that we constantly and consistently keep soaring towards our goal of engendering an atmosphere to empower SOCIALLY RESPONSIBLE CITIZENSHIP. While most would say food and water and the basic needs of life help a child survive, we at the Premia Academy beg to differ, we strongly believe that safety, love and a positive learning environment helps children thrive. </p>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row prodigy\" [ngClass]=\"{'active': tab==='tab1'}\" id=\"1\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <h2> <i class=\"icon icon-medium\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_ethicalEdu\"></use>\n              </svg>\n            </i>The safe and positive environment (Safety isn’t expensive, it's priceless):</h2>\n                    <p>\n                        At Premia we believe that a child's health and safety is paramount. A Safe and Positive Learning Environment is key to accomplishing our purpose. It is the launch pad that every child takes off from. Keeping this in mind has been the reason to ensure that all the facilities provided at The Premia Academy ensures the safety of all who enter our premises, including the air they breathe! A sophisticated Air conditioning system that allows us to breathe clean, purified air is only one of such thought processes. According to educational researcher Sheryl Feinstein’s book From the Brain to the Classroom. It was found that half of the learning impact came from light, temperature, and air quality.\n                    </p>\n                    <ul class=\"list\">\n                        <li>\n                            Centralized AC System in campus with VRF technology-Most ACs recycle 100% of the air which increases CO2 levels and doesn't filter out or deactivate airborne infections. Premia's state of the art Air conditioning system provides a mixture of fresh and recycled air to allow consistent oxygen levels at a pleasant temperature. UV lamps inside the ducting ensure that germs are eradicated.\n                        </li>\n                        <li>\n                            CCTV Surveillance\n                        </li>\n                        <li>\n                            Background verified Staff-All Teaching and Non Teaching staff at Premia have had to go through stringent background checks and police verification, undergone training on Premia's safety and security policies. Everyone including teaching staff and visitors are vetted and frisked prior to being allowed on campus. Visitors once registered in our visitor management system are accompanied by Premia staff at all times.\n                        </li>\n                        <li>\n                            Eco friendly campus - We use state of the art RO & UV plants to provide students with safe drinking water.\n                        </li>\n                        <li> Astroturf 5 aside Futsal field</li>\n                        <li> Acoustic Walls</li>\n                        <li> Public Addressing System -Our campus wide audio and video surveillance network consisting of over a 100 high definition cameras allows our team of trained professionals to monitor, identify and handle any situation with ease.</li>\n                        <li> Safe Transport Facility-All our Buses are operated by highly experienced bus drivers and include female attendants. Our buses capture all student entry and exits, have cctv monitoring and gps tracking.</li>\n                        <li> Kid friendly infrastructure.</li>\n                        <li> Regular Pest Control and Sanitization </li>\n                        <li>Tie-up with a Hospital</li>\n                        <li>Fully equipped infirmary access -Our on campus infirmary is operated by trained nurses where we maintain health records of all students. We have tied up with local hospitals for any emergencies.</li>\n                        <li> Counselling Support </li>\n                        <li> No Corporal Punishment</li>\n                    </ul>\n\n\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row prodigy\" [ngClass]=\"{'active': tab==='tab2'}\" id=\"2\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <h2> <i class=\"icon icon-medium\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_ethicalEdu\"></use>\n              </svg>\n            </i>Growth & Innovation mindset (Empower & Inspire)</h2>\n                    <p>\n                        All learning and nurturing becomes obsolete without the right mindset and attitude, as an institution we are devoted to raising children who will always choose to be the few who are change makers, risk takers and problem solvers. As young adults will empower and inspire all the lives they touch.\n                        <br> How do we do this?\n\n                    </p>\n                    <ul class=\"list\">\n                        <li>Establish School norms -Self goals are set with essential agreements and conveyed with positive statements.</li>\n                        <li> E4 circuit: Express, energise, endure & elevate : an initiative that helps with Democratized group work, Choice of tasks which are meaningful and relevant to one’s success and take responsibility for one's actions whilst reflecting and refining the set goals. </li>\n                        <li>Creya Design thinking program : helps sow the seeds of a constant resonance with a solution based approach. Help our students to identify, evaluate and solve the problem. </li>\n                        <li>Metamorphosis : an organisation that is the pioneer and expert in the field of teaching young minds the art and science of business and growth. </li>\n                        <li>Mentor counsel: organises career counselling drives and identifies kids passion and strength.\n\n                        </li>\n                    </ul>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row prodigy\" [ngClass]=\"{'active': tab==='tab3'}\" id=\"3\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <h2> <i class=\"icon icon-medium\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_ethicalEdu\"></use>\n              </svg>\n            </i>Quest for learning (Lifelong learners) </h2>\n                    <p>\n                        We as an institution are advocates of the thought process that learning never stops. If it does so does progress. All our children will be equipped with the skills and mindset to be lifelong learners on a quest to impact humanity in a promising and genuine manner. We teach our children how to learn not what to learn, thus ensuring their quest for learning stays ignited.\n                        <br> How do we do this?\n                    </p>\n                    <ul class=\"list\">\n                        <li>\n                            Robust and well rounded curriculum </li>\n                        <li> Differentiated learning- we are passionate and morally obligated to help students reach individual student goals </li>\n                        <li>Yardstick : partnered to bring a tactile and experiential learning to every child </li>\n                        <li>Number nuger. : to get the foundation of concepts and logic right, to ensure no child feels left behind. </li>\n                        <li>State of the art library: readers are people who can self learn indefinitely </li>\n                        <li>Scholastic bookroom. : a program designed to make every pupil a profound reader.\n\n                        </li>\n                    </ul>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row prodigy\" [ngClass]=\"{'active': tab==='tab4'}\" id=\"4\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <h2> <i class=\"icon icon-medium\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_ethicalEdu\"></use>\n              </svg>\n            </i>Integrity above all (Virtue in our veins) </h2>\n                    <p>\n                        The most integral part of our culture and curricula is our endeavour to have each and everyone of The Premia Family to be an exemplary reflection of integrity from the very fibre of our beings. It is emphasised in every area of our interaction with students, parents, teachers, staff and administration. We encourage students to correct their own wrongs as it persuades them to take responsibility for their actions.\n                        <br> How do we do this?\n                    </p>\n                    <ul class=\"list\">\n                        <li>We walk the talk</li>\n                        <li>Social emotional learning across all verticals</li>\n                        <li>Swadhyay - life enrichment value system- Ethos, ethics and etiquette become a way of life</li>\n                        <li>Guest interactions with people from all walks of life.</li>\n                        <li>Avani - our sustainable living curricula </li>\n                        <li>Impetus on Relationship Building – great bonds with family and friends help us become better people everyday.\n                        </li>\n                    </ul>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row prodigy\" [ngClass]=\"{'active': tab==='tab5'}\" id=\"5\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <h2> <i class=\"icon icon-medium\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_ethicalEdu\"></use>\n              </svg>\n            </i>Passion(Finding your inner strength)</h2>\n                    <p>\n                        Our varied platforms and events, help children identify their strengths, weaknesses and interest areas. Once children finish their 10th grade our mentors do career counselling with the help of scientific ability tests and personality tests to further help children choose their direction Once kids decide on their chosen fields, experts from the field will be invited to address and explain to our students about the permutations and combinations of their respective fields.\n                    </p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row prodigy\" [ngClass]=\"{'active': tab==='tab6'}\" id=\"6\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <h2> <i class=\"icon icon-medium\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_ethicalEdu\"></use>\n              </svg>\n            </i>Purpose (The Driving Force)</h2>\n                    <p>\n                        Good citizenship is about being a tribe that exudes peace and progress, while great citizenship is about impacting and changing lives for the better. We encourage our children to identify the purpose behind their passion and persistence.\n                    </p>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row prodigy\" [ngClass]=\"{'active': tab==='tab7'}\" id=\"7\">\n            <div class=\"col-lg-12 col-md-12 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <div class=\"panel\">\n                    <h2> <i class=\"icon icon-medium\">\n              <svg focusable=\"false\">\n                <use xlink:href=\"#icon_ethicalEdu\"></use>\n              </svg>\n            </i>Prodigy (Miracles in the making)</h2>\n                    <p>\n                        It's our driving force that all our children go on to achieve their aspirations and live lives that inspire one and all. Every step we take, every move we make, is an effort to ensure we awaken the hidden prodigy in every pupil. That journey builds itself on the bedrock of integrity, growth and innovation mindset and their tireless quest for knowledge. While everyone focuses on the thirst for materialistic success in life, little do we understand that fame, success and prosperity is the by-product of work done with passion and purpose.\n                    </p>\n                </div>\n            </div>\n        </div>\n\n    </div>\n</section>\n");

