/* harmony default export */ __webpack_exports__["default"] = ("<section class=\"section-study-culture\">\n    <div class=\"breadcum\">\n        <a>\n            <i class=\"icon icon-ex-small\">\n                <svg focusable=\"false\">\n                    <use xlink:href=\"#icon_home\"></use>\n                </svg>\n            </i>\n        </a>\n        <span> |</span>\n        <a>\n            The Premia Edge\n        </a>\n    </div>\n    <div class=\"row\">\n        <div class=\"col-lg-6 col-md-6 col-sm-12\">\n            <h1 data-aos=\"fade-up\" data-aos-once=\"true\">\n                The<br>\n                Premia Edge\n            </h1>\n            <div class=\"panel-body\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <p>The integrated curriculum at Premia comprises & aligns with all the learning outcomes in CBSE, IGCSE\n                    & AERO standards. The curriculum includes reading, writing, listening, speaking, social studies,\n                    math, science, health, physical education, music, and visual arts, experiential learning, public\n                    speaking, emphasis on projects, etc. We at Premia will utilize different approaches of integration\n                    best suited for the students:\n                </p>\n            </div>\n        </div>\n        <div class=\"col-lg-6 col-md-6 col-sm-12\" data-aos=\"fade-up\" data-aos-once=\"true\">\n            <img src=\"assets/images/8.jpg\">\n        </div>\n    </div>\n    <div class=\"clearfix\"></div>\n    <div class=\"row edge-info\">\n        <div class=\"col-lg-1 col-md-1 col-sm-12\"></div>\n        <div class=\"col-lg-11 col-md-11 col-sm-12 float-right\">\n            <div class=\"panel\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <h3 class=\"heading-title\"><span>Multi-Disciplinary Integration</span></h3>\n                <p>\n                    To focus on reading, writing, and communication in all its forms, in language arts. This approach\n                    focuses on integration within one subject area, teaching the content with deeper understanding.\n                </p>\n            </div>\n            <div class=\"panel\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <h3 class=\"heading-title\"><span>Inter-disciplinary integration</span></h3>\n                <p>\n                    Focuses on project-based learning in more than one subject area. Interdisciplinary integration\n                    assembles the teaching of several subjects around common issues, or problems, highlighting thematic\n                    concepts in which a common theme is studied.\n                </p>\n            </div>\n            <div class=\"panel\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <h3 class=\"heading-title\"><span>Trans-disciplinary integration</span></h3>\n                <p>\n                    Involves understanding the student’s interests, and concerns while encouraging them to ask questions\n                    to inquire about the subject matter from a variety of perspectives. Interdisciplinary integration\n                    incorporates information, involving students’ interests and questions\n                </p>\n            </div>\n        </div>\n    </div>\n\n    <div class=\"clearfix\"></div>\n    <div class=\"row edge-info\">\n        <div class=\"col-lg-1 col-md-1 col-sm-12\"></div>\n        <div class=\"col-lg-11 col-md-11 col-sm-12 float-right\">\n            \n            <h1 class=\"plan-title\" data-aos=\"fade-up\" data-aos-once=\"true\"><span>Key Areas of Learning</span></h1>\n    </div>\n       \n        <div class=\"col-lg-1 col-md-1 col-sm-12\"></div>\n        <div class=\"col-lg-11 col-md-11 col-sm-12 float-right\">\n           \n            <div class=\"panel\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <h3 class=\"heading-title\"><span>Communication and Language</span></h3>\n                <p>\n                   Communication and language development is about different ways\n                a child understands and communicates, using words, gestures or facial expressions. Being an\n                indicator of fine motor skill development and a reflection of cognitive development, reading\n                is one of the best ways to encourage communication and language development.</p>\n            </div>\n            <div class=\"panel\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <h3 class=\"heading-title\"><span>Personal, Social and Emotional Development</span></h3>\n                <p>\n                    It’s essential for children to feel\n                comfortable, emotionally and physically to learn effectively. Helping children to learn how\n                to regulate and manage their feelings is, therefore, a vital stepping stone for success in\n                learning and life.\n                </p>\n            </div>\n            <div class=\"panel\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                <h3 class=\"heading-title\"><span>Physical Development</span></h3>\n                <p>\n                    Children meet a myriad of physical development milestones in the\n                first few years of life, from walking to drawing. Physical development focuses on increasing\n                the skill and performance of the body. The development of children’s physical skills should\n                be developed holistically across all areas of learning.\n                </p>\n            </div>\n        </div>\n    </div>\n</section>\n\n\n<section class=\"section-explicit\">\n\n    <div class=\"container\">\n        <div class=\"row\">\n            \n            <h1 class=\"plan-title\" data-aos=\"fade-up\" data-aos-once=\"true\"><span>Explicit Areas of Learning</span></h1>\n    </div>\n     <ngx-slick-carousel class=\"row explicit-sec nav-tabs\" ngbNav #nav=\"ngbNav\" [(activeId)]=\"active\"\n     #slickModal=\"slick-carousel\" [config]=\"explicitConfig\" data-aos=\"fade-up\" data-aos-once=\"true\">\n              <li ngxSlickItem class=\"add-info\" ngbNavItem=\"{{i+1}}\"  *ngFor=\"let list of explicit; index as i\">\n                  <a ngbNavLink class=\"panel\">\n                      <div class=\"panel-heading\">\n                          <h1>{{list.bar}}</h1>\n                          <i class=\"icon icon-medium\">\n                            <svg focusable=\"false\">\n                                <use attr.xlink:href=\"{{list.icon}}\"></use>\n                            </svg>\n                        </i>\n                              <h6 class=\"bar _{{list.bar}}\">\n                                  {{list.title}}\n                              </h6>\n                            </div>\n                           \n                        </a>\n                     <ng-template ngbNavContent>\n                       {{list.description}}\n                    </ng-template>\n                </li>\n        </ngx-slick-carousel>   \n\n            <div [ngbNavOutlet]=\"nav\" class=\"tab-info\"></div>\n </div> \n  </section>");

