/* harmony default export */ __webpack_exports__["default"] = ("<section class=\"section-study-culture\">\n    <div class=\"breadcum\">\n        <a>\n            <i class=\"icon icon-ex-small\">\n                <svg focusable=\"false\">\n                    <use xlink:href=\"#icon_home\"></use>\n                </svg>\n            </i>\n        </a>\n        <span> |</span>\n        <a>\n            The\n            Premia Story\n        </a>\n    </div>\n\n    <div class=\"row-f\">\n        <h1>\n            The<br>\n            Premia Story\n        </h1>\n        <div class=\"col-lg-11 col-md-11 col-sm-12 story sub-header\">\n            <div class=\"panel\">\n                <h2 data-aos=\"fade-up\" data-aos-once=\"true\">\n                    Who we are\n                </h2>\n                <div class=\"panel-body\">\n                <p data-aos=\"fade-up\" data-aos-once=\"true\">\n                    <div class=\"img-flag d-sm-block d-md-none\" >\n                        <img src=\"assets/images/5.jpg\">\n                    </div>\n                    We are a group of committed individuals who believe that “What sculpture is to a block of marble, education is to the human soul.” Joseph Addison. \n                    <br><br>\n                    Our advisory board comprises diverse academicians who have a keen interest in providing a unique perspective to our collective vision. Individually they have contributed tremendously to the field of education, together they bring their unique capacities to our advisory board supporting continual improvement and sustainability.   \n                  </div>\n            </div>\n            <div class=\"row add-spec\">\n\n                <div class=\"col-lg-6 col-md-6 col-sm-12\">\n                    <p data-aos=\"fade-up\" data-aos-once=\"true\">\n                        We want to nurture a confident, compassionate student body that is ready to make a positive difference to the World. We affirm that every child deserves a childhood filled with love and positivism. That is the core belief, with which we will take care of each child, as this will contribute to making exemplary individuals. </p>\n                </div>\n                <div class=\"col-lg-6 col-md-6 col-sm-12\">\n                    <div class=\"row\">\n                    <div class=\"col-lg-4 col-md-4 col-sm-12\" *ngFor=\"let item of story; index as i\" data-aos=\"fade-up\" data-aos-once=\"true\">\n                        <div class=\"panel\">\n                            <div class=\"panel-front\">\n                                <div class=\"panel-heading\">\n                                    <i class=\"icon icon-medium\">\n                                        <svg focusable=\"false\">\n                                            <use attr.xlink:href=\"{{item.icon}}\"></use>\n                                        </svg>\n                                    </i>\n                                     \n                                        <p>{{item.description}}</p>\n                                </div>\n                             </div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n            </div>\n            <div class=\"doodle\">\n                The Premia Story\n            </div>\n        </div>\n        <div class=\"img-flag sub-header-image\" data-aos=\"fade-up\" data-aos-once=\"true\">\n            <img src=\"assets/images/5.jpg\">\n        </div>\n\n    </div>\n    <div class=\"clearfix\"></div>\n\n    <div class=\"row\" >\n        <div class=\"col-lg-1 col-md-1 col-sm-12\"></div>\n        <div class=\"col-lg-11 col-md-11 col-sm-12\"> <h2 data-aos=\"fade-up\" data-aos-once=\"true\">\n            The Quest\n        </h2></div>\n        <div class=\"col-lg-1 col-md-1 col-sm-12\"></div>\n\n        <div class=\"col-lg-11 col-md-11 col-sm-12\">\n        <div class=\"panel story-info\" data-aos=\"fade-up\" data-aos-once=\"true\">\n            <span class=\"flying-plane\">\n                <span>.........................................</span>\n            <i class=\"icon icon-small\">\n                <svg focusable=\"false\">\n                    <use xlink:href=\"#icon_plane\"></use>\n                </svg>\n            </i> \n        </span>\n            <p data-aos=\"fade-up\" data-aos-once=\"true\"> Just like any involved parent, our Director, Sinduri Reddy, began a quest to find a school that would nurture her growing preschoolers in the best way possible.  \n                <br><br>\n                After putting together the best of schools and undergoing immense research, there were still certain factors like cleanliness, Ethos, Curriculum Focus, distance, etc. that made it impossible for her to choose.  \n                <br><br>\n                So, like a popular thought,” when you can’t find someone to do exactly what you, get up and do it yourself!” That’s exactly what she did!  \n                <br><br>\n                Her endeavours have snowballed into the Premia Academy. \n                </p>\n               \n            </div>\n        </div>\n\n    </div>\n\n\n\n\n</section>");

